import './item.css'
function ReasonPopUp(props) {
  return (
<div>
{props.rejectPopUpRender && (
        <div className="iconVideo">
          <div className="VideoBox">
            <div className="d-flex justify-content-between p-3 pb-0">
             <p>შეიყვანეთ მიზეზი</p>

              <button
                type="button"
                className="btn-close"
                aria-label="Close"
                // onClick={(e) => props.SetrenderContact(!props.renderContact)}
              ></button>
            </div>
            <hr
              style={{
                width: "93%",
                height: "2px",
                margin: "auto",
                color: "#2558FF",
              }}
            />
            <div className="input-group flex-nowrap">
  <span className="input-group-text" id="addon-wrapping">@</span>
  <input type="text" class="form-control" placeholder="Username" aria-label="Username" aria-describedby="addon-wrapping"/>
</div>                

            <hr
              style={{
                width: "93%",
                height: "2px",
                margin: "auto",
                color: "#2558FF",
              }}
            />
          </div>
        </div>
      )}
    </div>

  );
}
export default ReasonPopUp;
